import React, { Component } from 'react';
import "../css/course-list.style.css";
import bootstrap from "react-bootstrap";

class Navbar extends Component {
    state = {  }
    render() { 
        return (
            <div className="container">
            <nav className="navbar navbar-default navbar-fixed-top">
                <div className="container-fluid">

                    <div className="navbar-header">
                        <a href="#">
                            <i className="fa fa-align-justify wbdv-field wbdv-hamburger"></i>
                        </a>
                    </div>
                    <ul className="nav navbar-nav">
                        <li className="active hidden-xs hidden-sm"><a href="#" className="wbdv-label wbdv-course-manager">Course Manager</a></li>
                        <li className="hidden-xs"><a href="#">Page 1</a></li>
                        <li className="hidden-xs"><a href="#">Page 2</a></li>
                    </ul>
                    <form className="navbar-form navbar-right">
                        <div className="input-group wbdv-field wbdv-new-course">
                            <input type="text" className="form-control hidden-xs hidden-sm" placeholder="Search" name="search"/>
                            <div className="input-group-btn hidden-xs hidden-sm">
                                <button className="btn btn-default wbdv-button wbdv-add-course" type="submit">
                                    <i className="fa fa-plus"></i>
                                </button>
                            </div>
                        </div>
                    </form>
                </div>
            </nav>
            </div>  
          );
    }
}

export default Navbar;
